import {AiOutlineMenu} from "react-icons/ai"
import {AiOutlineClose} from "react-icons/ai"
import { Link } from "react-router-dom"
import { useState } from "react"

function Header(){

    const [isOpen, setisOpen] = useState(false)
    const [isnOpen, setisnOpen] = useState(false)

    const hbtn = () => {
        if(isOpen === true) {
            setisOpen(AiOutlineClose)
        } else {
            setisOpen(!isOpen)
        }
        // setisOpen(!isOpen)
        // setisnOpen(isnOpen)
    }
    


    return <div className="header">
            <h1>LOGO</h1>

            <button onClick={hbtn}> {isOpen ? <AiOutlineClose  className="btn" size="40px" color="seagreen"/> :  <AiOutlineMenu  className="btn" size="40px" color="seagreen"/>           
 }  

     </button>


        <ul style={{display: isOpen ? "flex" : "none" }} >
            <li><Link to="/home">Home</Link></li>
            <li><Link to="/Service">Service</Link></li>
            <li><Link to="/Features">Features</Link></li>
            <li><Link to="/Blog">Blog</Link></li>
        </ul>
    </div>
}

export default Header
